const photo = 'https://static-00.iconduck.com/assets.00/person-icon-476x512-hr6biidg.png'
const personsBlock = document.querySelector('.persons')
const objectPersonsJSON= new XMLHttpRequest()
objectPersonsJSON.open('GET', 'persons.json')
objectPersonsJSON.setRequestHeader('Content-type', 'application/json')
objectPersonsJSON.send()
objectPersonsJSON.addEventListener('load' , () =>{
    const objectPerson = JSON.parse(objectPersonsJSON.response)
    objectPerson.forEach((person) =>{
        const personCard = document.createElement('div')
        personCard.setAttribute("class", 'personCard')
        personCard.innerHTML=`
            <div class="person_photo">
                <img src="${person.photo || photo} " alt="${person.name}">
            </div>
            <h2>${person.name}</h2>
            <span>age: ${person.age}</span>  
        `

        personsBlock.append(personCard)
    })
} )





const request = new XMLHttpRequest();
request.open('GET', 'bleach.json');
request.setRequestHeader('Content-type', 'application/json');
request.send();
request.addEventListener('load', () => {
    if (request.status >= 200 && request.status < 300) {
        const data = JSON.parse(request.response);
        console.log('Title:', data.title);
        console.log('Creator:', data.creator);
        console.log('Genre:', data.genre);
        console.log('mangaStatus:', data.mangaStatus);
        console.log('MainCharacter:', data.mainCharacter)
        console.log('Antagonists:', data.antagonists)
        console.log('BestFamaleCharacter:', data.bestFemaleCharacter)
        console.log('BestWaifuInTheTitle:', data.bestWaifuInTheTitle)
    } else {
        console.error('Ошибка при выполнении запроса:', request.statusText);
    }
});


